description:
PLOT

New York City Police Detectives Christopher Danson (Dwayne Johnson) and P. K. Highsmith (Samuel L. Jackson) are the toughest and most famous cops in the city with the best capture rate no matter what it takes to get their man, even if the city must pay $12 million in property damages to capture a small crook. However, in their ranks, there are two other detectives that are want-to-be heroes sitting in the wings. Detective Allen Gamble (Will Ferrell) and Terry Hoitz (Mark Wahlberg) just want their chance in the sun to make a big collar and get a medal too. They get their chance when a small case falls into their lap which ends up being a very big high-profile case instead. It's the opportunity they have been waiting for, but do they have what it takes to be the next police heroes. Douglas Young (the-movie-guy) 

REVIEW

I saw the advanced screening tonight in New York City and it was hilarious. The dry humor was tremendous and the chemistry between Marky Mark and Will Ferrell is unmatched. They were so funny together it was great. The story of the movie is pretty predictable but there legit is non stop laughter through the entire film. The only draw back was the length of the movie, they could have trimmed it a bit but overall it's a solid summer comedy. Dare I say this was Will Ferrell's best performance since Anchorman. It's certainly one of those movies you will be quoting with your friends for a long time. The entire theater was laughing throughout the entire thing..Great movie...go check it out.


